import Banner from "../components/Banner";
import Heading from "../components/Heading";
import Slider from "react-slick";
import CategoryCard from "../components/CategoryCard";
import {
  arr1,
  fa1,
  fa2,
  fa3,
  fa4,
  fa5,
  fa6,
  featured1,
} from "../assets/images/products";
import FeaturedCard from "../components/FeaturedCard";
import AccessoryCard from "../components/AccessoryCard";
import FashionCard from "../components/FashionCard";
import { Link } from "react-router-dom";
import ServiceCard from "../components/ServiceCard";
import {
  ArrowBackRoundedIcon,
  ArrowForwardRoundedIcon,
  apple,
  cc,
  fd,
  secure,
} from "../assets/icons";

function SampleNextArrow(props) {
  const { onClick } = props;
  return (
    <div className="arrow -right-5" onClick={onClick}>
      <ArrowForwardRoundedIcon />
    </div>
  );
}

function SamplePrevArrow(props) {
  const { onClick } = props;
  return (
    <div className="arrow -left-5" onClick={onClick}>
      <ArrowBackRoundedIcon />
    </div>
  );
}

const Homepage = () => {
  const settings = {
    infinite: false,
    speed: 500,
    slidesToShow: 8,
    slidesToScroll: 8,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 5,
          slidesToScroll: 5,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          initialSlide: 2,
        },
      },
    ],
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
  };

  return (
    <section className="max-container px-5">
      <Banner />
      <div className="py-10 flex flex-col gap-10">
        <div className="product-catalog">
          <Heading title={"Categories"} heading={"Browse By Category"} btn={false} />
          <Slider {...settings}>
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
            <CategoryCard title={"Clothes"} image={apple} />
          </Slider>
        </div>

        <div className="product-catalog">
          <Heading
            title={"Featured Products"}
            heading={"Our Featured Products"}
          />
          <div className="grid grid-cols-5 gap-4">
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
